import React from "react";
import Box from '@mui/material/Box';

function Signin(){

    return(

        <Box  
                sx={{
                    width:1000,
                    heigth:500,
                    border:'1px solid green',
                    position:"relative",
                    top:400,
                    left:'20%',
                    display:'flex',
                    alignItems:'center'



                }}>
             <Box
                    sx={{
                    width: 800,
                    height: 400,
                    border:'1px solid red',
                    position:'relative',

                    }}> 

            </Box>

            <Box
                    sx={{
                    width: 500,
                    height: 500,
                    border:'5px solid blue',
                    position:'relative',
                    right:300,
                    bottom:50

                    }}> 

            </Box>
        </Box>
    )

}
export default Signin
